import React, { useState, useEffect } from 'react';
import { Button } from 'react-bulma-components';

function Feed({ albums }) {
  return (
    [albums.map((album, i) => (
        <div key={album.tralbum_id} id={album.tralbum_id}>
            <p>{album.title}</p>
            <Button>Bulma btb</Button>
        </div>

    ))]

  )
}

export default Feed
